pragma solidity 0.5.17;

import "./AnonNado.sol";

contract ZephNado is AnonNado {
  address public token;

  address payable public owner_address = 0x9259950b5C9Bc3f4bf95a04be5eB652DCFB8790C;
  // get owner fee 0.5%
  uint256 public fee_owner = 200; 

  constructor(
    IVerifier _verifier,
    uint32 _merkleTreeHeight,
    address _operator
  ) AnonNado(_verifier, _merkleTreeHeight, _operator) public {

  }
  
  function _processDepositErc20(address _erc20TokenAddr, uint256 _depositAmt) internal {
    // check native token deposit
    if (_erc20TokenAddr != address(0)) {
      require(msg.value == 0, "ETH value is supposed to be 0 for ERC20 instance");
      _safeErc20TransferFrom(msg.sender, address(this), _erc20TokenAddr, _depositAmt);
    }
  }

  function _processWithdraw(address payable _recipient, address payable _relayer, uint256 _fee, uint256 _refund, address payable _erc20TokenAddr, uint256 _amount) internal {

    if (_erc20TokenAddr != address(0)) {
      require(msg.value == _refund, "Incorrect refund amount received by the contract");

      _safeErc20Transfer(_recipient, _erc20TokenAddr, _amount - _fee - (_amount/fee_owner));
      if (_fee > 0) {
        _safeErc20Transfer(_relayer, _erc20TokenAddr, _fee);
      }

      if (_refund > 0) {
        (bool success, ) = _recipient.call.value(_refund)("");
        if (!success) {
          // let's return _refund back to the relayer
          _relayer.transfer(_refund);
        }
      }

      // transfer fee to owner
      _safeErc20Transfer(owner_address, _erc20TokenAddr, (_amount/fee_owner));
      
    } else {
      _ETHTransfer(_recipient, _relayer, _fee, _refund, _amount);
    }    
  }

  function _safeErc20TransferFrom(address _from, address _to, address _token, uint256 _amount) internal {
    (bool success, bytes memory data) = _token.call(abi.encodeWithSelector(0x23b872dd /* transferFrom */, _from, _to, _amount));
    require(success, "not enough allowed tokens");

    // if contract returns some data lets make sure that is `true` according to standard
    if (data.length > 0) {
      require(data.length == 32, "data length should be either 0 or 32 bytes");
      success = abi.decode(data, (bool));
      require(success, "not enough allowed tokens. Token returns false.");
    }
  }

  function _safeErc20Transfer(address _to, address _token, uint256 _amount) internal {
    (bool success, bytes memory data) = _token.call(abi.encodeWithSelector(0xa9059cbb /* transfer */, _to, _amount));
    require(success, "not enough tokens");

    // if contract returns some data lets make sure that is `true` according to standard
    if (data.length > 0) {
      require(data.length == 32, "data length should be either 0 or 32 bytes");
      success = abi.decode(data, (bool));
      require(success, "not enough tokens. Token returns false.");
    }
  }

  function _ETHTransfer(address payable _recipient, address payable _relayer, uint256 _fee, uint256 _refund, uint256 _amount) internal {
    // sanity checks
    require(msg.value == 0, "Message value is supposed to be zero for ETH instance");
    require(_refund == 0, "Refund value is supposed to be zero for ETH instance");

    // send to redipient 
    (bool success, ) = _recipient.call.value(_amount - _fee - (_amount/fee_owner))("");      
    require(success, "payment to _recipient did not go thru");    
    
    // send fee to relayer
    if (_fee > 0) {
      (success, ) = _relayer.call.value(_fee)("");
      require(success, "payment to _relayer did not go thru");
    }

    // send fee to owner
    (bool success_owner, ) = owner_address.call.value(_amount/fee_owner)("");     
    require(success_owner, "payment to owner did not go thru");
    
  }

  function setCollectionAddress(address payable _collector) public onlyOwner {
    owner_address = _collector;
  }

  function setTransferFee(uint256 _transferFee) public onlyOwner {
    fee_owner = _transferFee;
  }

  function getCollectionAddress() public view returns(address payable) {
    return owner_address;
  }

  function getTransferFee() public view returns(uint256) {
    return fee_owner;
  }
}
